import Link from "next/link";

const Header = () => (
  <>
    <div className="navbar">
      <div className="wrapper">
        <Link href="/">
          <a className="navlink">Home</a>
        </Link>
        <Link href="/about">
          <a className="navlink">About</a>
        </Link>
      </div>
    </div>
    <style jsx>
      {`
        .navbar {
          width: 100%;
          border: 3px solid yellow;
        }

        .wrapper {
          display: flexbox;
          float: left;
          padding-left: 50px;
          border: 3px solid orange;
        }

        .navlink {
          display: inline-block;
          border: 3px solid;
          transform: rotate(-90deg);
          color: #00ace6;
          font-family: "Arial";
          margin: 5px;
          padding: 10px;
          text-decoration: none;
          box-shadow: 3px 3px 10px 0.5px #ddd;
        }

        .navlink:hover {
          opacity: 0.6;
        }
      `}
    </style>
  </>
);

export default Header;
